import React from 'react';
import {useState} from 'react';
import ReactDOM from 'react-dom/client';
import { Link } from "react-router";



export default function Page2() {

    const [inputs, setInputs] = useState({});
    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setInputs(values => ({...values, [name]: value}))
      }
      const handleSubmit = (event) => {
        event.preventDefault();  
      }
      const forceNumber = (event) => {
        const regex = /^[0-9]+$/;
        if(regex.test(event.target.value)){
            event.target.value = Number(event.target.value);
        }
      }

    return (

<body>
            <header><h1>MedLab Registration Form</h1></header>
            <form onSubmit={handleSubmit}>
            <h2>Patient information</h2>
                <label >First Name:</label>
                <input  
                    type="text"
                    name="first_name"
                    value={inputs.first_name || ""} 
                    onChange={handleChange}
                />
                <br/>
                <label >Last Name:</label>
                <input  
                    type="text"
                    name="last_name"
                    value={inputs.last_name || ""}
                    onChange={handleChange}
                />
                <br/>
                <label >Date of birth:</label>
                <input  
                    type="date"
                    name="DOB"
                    value={inputs.dob || ""}
                    onChange={handleChange}
                />
                <br/>
                <label >Email:</label>
                <input  
                    type="email"
                    name="email"
                    value={inputs.email || ""}
                    onChange={handleChange}
                />
                 <br/>
                <label >Phone Number:</label>
                <input 
                    type="tel"
                    name="phone"
                    pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}" required
                    value={inputs.phone || ""}
                    onChange={handleChange}
                />
                <br/>
                <label >Address:</label>
                <input  
                    type="text"
                    name="address1"
                    value={inputs.address1 || ""}
                    onChange={handleChange}
                />
                <label id="address2">Apt:</label>
                <input id="address2"
                    type="text"
                    name="address2" 
                    value={inputs.address2 || ""}
                    onChange={handleChange}
                    />
                 <br/>
                <label >City:</label>
                <input  
                    type="text"
                    name="city" 
                    value={inputs.city || ""}
                    onChange={handleChange}
                />           
                 <br/>
                <label >State:</label>
                <input  
                    type="text"
                    name="state" 
                    value={inputs.state || ""}
                    onChange={handleChange}
                />
                <br/>
                <label>Zip code:</label>
                <input  
                    type="number"
                    name="zip" 
                    value={inputs.zip || ""}
                    onChange={(handleChange,forceNumber)}
                />
                <br/> <br/>
                <nav>
                    <Link to="/page1">
                        <input class="button"  type="button" value="Go Back" />
                    </Link>
                    <Link to="/page3">
                        <input class="button" type="button" value="Next" />
                    </Link>
                </nav>
            </form>
            <footer>
                    <div id="address">MedLab Medical Clinics of America <br/>
                         1074 Jadewood Drive, Suite 330 <br/>
                         Chicago, Illinois 60647 <br/>
                    </div>
                     <div id="contact">
                         Phone: 630-921-0000 <br/>
                         Fax: 773-709-3312
                    </div>
             </footer>
                
            
        </body>
    )
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
 <Page2/>
);
